import '../styles/Navbar.css';
import CircleIcon from './CircleIcon';

function Navbar() {
  return (
    <nav className="navbar">
      <CircleIcon icon={<i class="ri-settings-4-line"></i>} />
      <h3 style={{color: 'var(--text-color)'}}>Daily</h3>
    </nav>
  );
}

export default Navbar;
